import React from 'react';
import { url } from '../../config';

const CategoryItem = () => {
    return (
        <div className="col">
            <div className="inner-category active">
                <div className="icon-wrap" data-category="latest-recipe">
                    <img id="icon-image" src={`${url}/uploads/category-icons/hops-active.png`} />
                    <a id="icon-link" className="active-link" href="#!">Latest Recipe</a>
                </div>
            </div>
        </div>
    )
}

export default CategoryItem;
